import React from "react";

export default function TermsOfUse() {
    return (
        <div className="Terms-of-use">
            <h1>Termos e Condições de Uso</h1>
            <h3>
                Conheça os direitos e responsabilidades que regem o bom uso
                deste portal.
            </h3>
        </div>
    );
}
